import {Button} from 'semantic-ui-react';
class Managermain extends React.Component {
    render() {
        return (
            <div>
                <Managerheader1/>
                <div className="ui left fixed vertical menu">
                    <div className="item">
                        <img src={NINE} alt="nineleaps"/>
                    </div>
                    <a className="item">MANAGER</a>
                    <a className="item">HR</a>
                    <a className="item">FEEDBACK</a>
                       <a className="item">GOALS</a>
                </div>
                <h1>    </h1>
            </div>
        )
    }
}
